import '../../styles/Main.css';
import PrimiseList from './PrimiseList';
import axios from 'axios';
import { useState, useEffect } from 'react';

function MainArea() {
    const [typesPremies, setTypesPremies] = useState([]);
    const [filters, setFilters] = useState({
        pool : false,
        billiards: false,
        furniture: false,
    });

    const [premises, setPremises] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3001/premise/notrenated');
                setPremises(response.data);
                console.log(response.data);
            } catch (error) {
                console.error('Ошибка загрузки данных:', error);
            }

            try {
                const response = await axios.get('http://localhost:3001/type_premise/all');
                setTypesPremies(response.data);
            } catch (error) {
                console.error('Ошибка загрузки данных:', error);
            }
        };

        // Загрузка данных с сервера при монтировании компонента
        fetchData();
    }, []);

    const changeTypePremise = (id) => async (e) => {
        try {
            const response = await axios.get(`http://localhost:3001/premise/notrenated?id=${id}`);
            setPremises(response.data);
        } catch (error) {
            console.error('Ошибка загрузки данных:', error);
        }
    };

    const сhangeFilters = (e) => {
        const { name, checked } = e.target;
        setFilters({
            filters,
            [name]: checked, // Обновляем состояние только выбранного чекбокса
        });
    };

	return (
	    <div className="mainArea">
            <div className="filters">
                <div className="typesPremies">
                    {typesPremies.map((typePremies) => (
                        <button onClick={changeTypePremise(typePremies.ID)}><p>{typePremies.Name}</p></button>
                    ))}
                </div>
                <form className="mainFilters">
                    <div className="filterElement">
                        <p>Цена аренды:</p>
                        <div className="inputFilter">
                            <input type="text" placeholder="От"/>
                            <input type="text" placeholder="До" style={{marginLeft: '10px'}}/>
                        </div>
                    </div>
                    <div className="filterElement">
                        <p>Площадь помещения:</p>
                        <div className="inputFilter">
                            <input type="text" placeholder="От"/>
                            <input type="text" placeholder="До" style={{marginLeft: '10px'}}/>
                        </div>
                    </div>
                    <div className="filterElement">
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="type_premies"/>
                            <label for="no">Фильр 1</label>
                        </div>
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="pool" checked={filters.pool} onChange={сhangeFilters}/>
                            <label for="no">Бассейн</label>
                        </div>
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="billiards" checked={filters.billiards} onChange={сhangeFilters}/>
                            <label for="no">Бильярд</label>
                        </div>
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="type_premies"/>
                            <label for="no">Фильр 1</label>
                        </div>
                    </div>
                </form>
            </div>

            <PrimiseList premises={premises}/>
        </div>
  	);
}

export default MainArea;
